import { Dialog } from '@mui/material'
import React from 'react'


const LoginDialog = (props) => {
  console.log(props)
  const handleClose =() =>{
    props.setOpen(false)
  }
  return (
   <>
    <Dialog open={props.openDialog} close={handleClose}>
    hello
    </Dialog>
   </>
  )
}

export default LoginDialog
